import Nav from './components/Nav'
import Home from './components/pages/Home'

import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
function App() {
  return (
    <Router>
        <Nav />
        <Switch>
          <Route path = "/" exact/>
        </Switch>
    </Router>
  );
}

export default App;
